import React, { useState, useEffect } from "react";
import { useHistory } from "react-router-dom";

import NavBar from "./NavBar"
import StallLiu from "../assets/stallliu.png"
import LockerMain from "../assets/lockermain.png"
import WuRoom from "../assets/wulockerroom.png"
import NikoShot from "../assets/nikoshot.png"
const CoachesPage = ({ match  }) => {

    return ( 
        <>
        <NavBar></NavBar>
            <div className="w-full flex">
                <div>
                    <p className="text-4xl pt-24 w-1/4 px-24 font-semibold">Coaches.</p>
                    <p className="px-24 w-2/3">We are thankful to welcome a wonderful group of Coaches and staff in for our 2021-2022 season. The Washington University Ice Hockey team head Coach is Chris Nikonovich.</p>
                    <div className="flex mt-12 w-2/3 mx-auto">
                        <img src={NikoShot} className="rounded-full w-1/6 border-4 border-black"></img>
                    </div>
                </div>

            </div>

    </>
    )

};

export default CoachesPage;
